import { hex2abc } from '@common/crypto/hex2abc';
import { MurmurHash3 } from 'murmurhash-wasm';

export class MurmurHash {
  public static hash(key: string, seed = 0): string {
    const hash = MurmurHash3.hash32(key, seed);
    const value = hash.readUInt32BE();
    const hex = value.toString(16);

    return hex2abc(hex);
  }
}

export default MurmurHash;

import { AnyRecord, ArrayUnionToIntersection, Nullish, PrimitiveMap } from '@common/types';

export const unique = <T>(items: T[]): T[] => Array.from(new Set(items));

export const without = <T>(items: T[], index: number): T[] => (index < 0 ? items : [...items.slice(0, index), ...items.slice(index + 1)]);

export const withoutValue = <T>(items: T[], value: T): T[] => without(items, items.indexOf(value));

export const withoutValues = <T>(items: T[], values: T[]): T[] => items.filter((item) => !values.includes(item));

export const replace = <T>(items: T[], index: number, item: T): T[] =>
  index < 0 ? items : [...items.slice(0, index), item, ...items.slice(index + 1)];

export const insert = <T>(items: T[], index: number, item: T): T[] =>
  index < 0 ? [item, ...items] : [...items.slice(0, index), item, ...items.slice(index)];

export const insertAll = <T>(items: T[], index: number, additionalItems: T[]): T[] =>
  index < 0 ? [...additionalItems, ...items] : [...items.slice(0, index), ...additionalItems, ...items.slice(index)];

export const append = <T>(items: T[], item: T): T[] => (items.includes(item) ? items : [...items, item]);

export const toggleMembership = <T>(items: T[], item: T): T[] => (items.includes(item) ? withoutValue(items, item) : [...items, item]);

export const head = <T>(items: T[]): [T, T[]] => {
  const [first, ...rest] = items;
  return [first, rest];
};

export const tail = <T>(items: T[]): [T[], T] => {
  const last = items[items.length - 1];
  const rest = items.slice(0, -1);
  return [rest, last];
};

export const reorder = <T>(items: T[], fromIndex: number, toIndex: number): T[] => {
  if (fromIndex < 0 || fromIndex >= items.length) {
    return items;
  }

  if (toIndex <= 0) {
    return [items[fromIndex], ...without(items, fromIndex)];
  }

  if (toIndex >= items.length) {
    return [...without(items, fromIndex), items[fromIndex]];
  }

  return insert(without(items, fromIndex), toIndex, items[fromIndex]);
};

export const separate = <T>(items: T[], predicate: (item: T, index: number) => boolean): [T[], T[]] =>
  items.reduce<[T[], T[]]>(
    ([passAcc, failAcc], item, index) => {
      if (predicate(item, index)) {
        passAcc.push(item);
      } else {
        failAcc.push(item);
      }

      return [passAcc, failAcc];
    },
    [[], []]
  );

interface CreateEntries {
  <T extends PropertyKey>(array: readonly T[]): Array<readonly [T, T]>;
  <T extends AnyRecord, K extends PropertyKey = string>(array: readonly T[], getKey: (value: T) => K): Array<readonly [K, T]>;
}

interface CreateMap {
  <T extends PropertyKey>(array: readonly T[]): PrimitiveMap<T>;
  <T extends AnyRecord, K extends PropertyKey = string>(array: readonly T[], getKey: (value: T) => K): Record<K, T>;
}

export const createEntries: CreateEntries = (array: readonly unknown[], getKey = (value: unknown) => value) =>
  array.map((item) => [getKey(item), item] as const);

export const createMap: CreateMap = (array: readonly any[], getKey = (value: any) => value) => Object.fromEntries(createEntries(array, getKey));

export const findUnion = <T>(lhs: T[], rhs: T[]): { rhsOnly: T[]; lhsOnly: T[]; union: T[] } => {
  // using sets instead of arrays since .has is O(1)
  const lSet = new Set(lhs);
  const rSet = new Set(rhs);
  const unionSet = new Set([...lhs, ...rhs]);

  const result = { rhsOnly: [] as T[], lhsOnly: [] as T[], union: [] as T[] };

  // eslint-disable-next-line no-restricted-syntax
  for (const item of unionSet) {
    if (lSet.has(item)) {
      if (rSet.has(item)) {
        result.union.push(item);
      } else {
        result.lhsOnly.push(item);
      }
    } else {
      result.rhsOnly.push(item);
    }
  }

  return result;
};

export const diff = <T>(lhs: T[], rhs: T[]): T[] => {
  const { lhsOnly, rhsOnly } = findUnion(lhs, rhs);

  return [...lhsOnly, ...rhsOnly];
};

export const hasIdenticalMembers = <T>(lhs: T[], rhs: T[]): boolean => {
  if (lhs.length !== rhs.length) {
    return false;
  }

  if (!lhs.length && !rhs.length) {
    return true;
  }

  return !lhs.some((value) => !rhs.includes(value));
};

export const asyncForEach = async <T>(array: T[], callback: (item: T, index: number, array: T[]) => Promise<void>): Promise<void> => {
  for (let index = 0; index < array.length; index++) {
    // eslint-disable-next-line callback-return,no-await-in-loop
    await callback(array[index], index, array);
  }
};

export const isNullish = (value: unknown): value is Nullish => value === null || value === undefined;

export const isNotNullish = <T>(value: T): value is NonNullable<T> => value !== null && value !== undefined;

/** @deprecated Use `array.filter(isNotNullish)` instead. */
export const filterOutNullish = <T>(items: readonly T[]): Array<NonNullable<T>> => items.filter(isNotNullish);

// mostly just saves us needing to traverse an array twice
export const filterAndGetLastRemovedValue = <T>(list: T[], filter: (item: T) => boolean): [T[], T | null] => {
  let lastItem: T | null = null;

  const filteredList = list.filter((a) => {
    if (filter(a)) return true;

    lastItem = a;

    return false;
  });

  return [filteredList, lastItem];
};

export const inferUnion = <T extends ArrayLike<unknown>>(array: T): ArrayUnionToIntersection<T> => array as unknown as ArrayUnionToIntersection<T>;

export const toArray = <T>(valueOrArray: T | T[]): T[] => (Array.isArray(valueOrArray) ? valueOrArray : [valueOrArray]);

/**
 * Merge together two arrays, if two items have the same identity based on the {@link identify} function
 * they will be merged together using the {@link merge} function provided.
 * @param items Array of items as a starting base.
 * @param newItems Array of items to merge in.
 * @param identify Function returning how to identify an item in the array
 * @param merge Function given two matching item identifiers, returning a single merged result
 * @example
 * const existingItems = [{a: 1, b: [1, 2, 3]}, {a: 2, b: [4]}];
 * const newItems = [{a: 1, b: [5]}, {a: 3, b: [6, 7]}];
 *
 * const items = mergeByIdentifier(
 *   existingItems,
 *   newItems,
 *   (item) => item.a,
 *   (existingItem, newItem) => {
 *     return {
 *       ...existingItem,
 *       b: [...existingItem.b, ...newItem.b]
 *     }
 *   }
 * );
 *
 * items == [{a: 1, b: [1, 2, 3, 5]}, {a: 2, b: [4]}, {a: 3, b: [6, 7]}];
 */
export const mergeByIdentifier = <T>(
  items: T[],
  newItems: T[],
  identify: (item: T, index: number) => string,
  merge: (item1: T, item2: T) => T
): T[] => {
  const newItemsMap = new Map(newItems.map((newItem, i) => [identify(newItem, i), newItem]));

  const result = items.map((item, i) => {
    const itemIdentity = identify(item, i);

    const matchingNewItem = newItemsMap.get(itemIdentity);
    if (matchingNewItem) {
      newItemsMap.delete(itemIdentity);

      return merge(item, matchingNewItem);
    }
    return item;
  });

  return result.concat(Array.from(newItemsMap.values()));
};

const FORMAT = /^[\w!#$%&'*+./=?^`{|}~-]+@[\dA-Za-z](?:[\dA-Za-z-]{0,61}[\dA-Za-z])?(?:\.[\dA-Za-z](?:[\dA-Za-z-]{0,61}[\dA-Za-z])?)*$/;

export const isValidEmail = (email: string): boolean => email.length < 320 && FORMAT.test(email);

export const getEmailDomain = (email: string): string => email.slice(Math.max(0, email.lastIndexOf('@') + 1));

import { Nullish } from '../types';

export const isFunction = <T extends (...args: any[]) => any = (...args: any[]) => any>(value: unknown): value is T => typeof value === 'function';

export type Transform<T = any, R = T> = (value: T) => R;

export interface Compose {
  <R, T1>(t0: Transform<T1, R>): (value: T1) => R;
  <R, T1, T2>(t0: Transform<T1, T2>, t1: Transform<T2, R>): (value: T1) => R;
  <R, T1, T2, T3>(t0: Transform<T1, T2>, t1: Transform<T2, T3>, t2: Transform<T3, R>): (value: T1) => R;
  <R, T1, T2, T3, T4>(t0: Transform<T1, T2>, t1: Transform<T2, T3>, t2: Transform<T3, T4>, t3: Transform<T4, R>): (value: T1) => R;
  <R, T1, T2, T3, T4, T5>(t0: Transform<T1, T2>, t1: Transform<T2, T3>, t2: Transform<T3, T4>, t3: Transform<T4, T5>, t4: Transform<T5, R>): (
    value: T1
  ) => R;
  <R, T1, T2, T3, T4, T5, T6>(
    t0: Transform<T1, T2>,
    t1: Transform<T2, T3>,
    t2: Transform<T3, T4>,
    t3: Transform<T4, T5>,
    t4: Transform<T5, T6>,
    t5: Transform<T6, R>
  ): (value: T1) => R;
  (...transforms: Transform[]): <T extends object>(value: T) => T;
}

export const compose: Compose =
  (...transforms: Transform[]) =>
  <T extends object>(value: T): T => {
    if (transforms.length === 1) {
      return transforms[0](value);
    }

    if (transforms.length === 2) {
      return transforms[0](transforms[1](value));
    }

    return transforms.reduceRight((acc, transform) => transform(acc), value);
  };

export type VoidFunction = () => void;

export const noop: VoidFunction = () => undefined;

export const identity = <T>(value: T): T => value;

export const stringify = (value: any): string => (typeof value === 'string' ? value : String(value));

type ChainCallback<A extends any[]> = (...args: A) => void;

export const chain =
  <A extends any[]>(...fns: [Nullish<ChainCallback<A>>, ...Array<Nullish<ChainCallback<A>>>]) =>
  (...args: A): void => {
    // perf optimization, most of the time we have one or two functions
    if (fns.length === 1) {
      fns[0]?.(...args);
    } else if (fns.length === 2) {
      fns[0]?.(...args);
      fns[1]?.(...args);
    } else {
      fns.forEach((fn) => fn?.(...args));
    }
  };

export const chainVoid =
  (...fns: [Nullish<VoidFunction>, ...Array<Nullish<VoidFunction>>]) =>
  (): void =>
    chain(...fns)();

export const chainAsync =
  <A extends any[]>(...fns: [Nullish<ChainCallback<A>>, ...Array<Nullish<ChainCallback<A>>>]) =>
  async (...args: A): Promise<void> => {
    // perf optimization, most of the time we have one or two functions
    if (fns.length === 1) {
      await fns[0]?.(...args);
    } else if (fns.length === 2) {
      await fns[0]?.(...args);
      await fns[1]?.(...args);
    } else {
      // eslint-disable-next-line no-restricted-syntax
      for (const fn of fns) {
        // eslint-disable-next-line no-await-in-loop
        await fn?.(...args);
      }
    }
  };

export const chainVoidAsync =
  (...fns: [Nullish<VoidFunction>, ...Array<Nullish<VoidFunction>>]) =>
  (): Promise<void> =>
    chainAsync(...fns)();

export const withEffect =
  <T>(callback: (value: T) => void) =>
  (value: T): T => {
    callback(value);

    return value;
  };

export const delay = <T = boolean>(timeout: number, value: T = true as unknown as T): Promise<T> =>
  new Promise<T>((resolve) => {
    setTimeout(() => resolve(value), timeout);
  });

export const rejectIn = (timeout: number): Promise<never> =>
  new Promise<never>((_resolve, reject) => {
    setTimeout(() => {
      reject(new Error('Rejected by timeout!'));
    }, timeout);
  });

import ObjectId from 'bson-objectid';
import cuid from 'cuid';

import { EmptyObject } from '../types';
import { deepMap, deepMapKeys } from './object';

export { cuid };

export const objectID = (): string => new ObjectId().toHexString();

export const remapObjectIDs = <T extends Readonly<EmptyObject>>(object: T, lookupMap: Record<string, string> | Map<string, string>): T => {
  const map: ReadonlyMap<string, string> = lookupMap instanceof Map ? lookupMap : new Map(Object.entries(lookupMap));

  const mapping = (value: any) => {
    if (typeof value === 'string' && map.has(value)) {
      return map.get(value)!;
    }

    return value;
  };

  return deepMapKeys(deepMap(object, mapping), mapping);
};

export * from './common';
export * from './deepMap';
export * from './diff';
export * from './keys';

import { AnyRecord, Struct } from '@common/types';

export { default as shallowEquals } from 'shallowequal';

export const selectField =
  <K extends string | number>(field: K) =>
  <T extends { [key in K]: any }>(obj: T): T[K] =>
    obj[field];

export const selectID = selectField('id');

export const selectKey = selectField('key');

export const selectValue = selectField('value');

export const isObject = (obj: unknown): obj is Struct => obj !== null && typeof obj === 'object';

export const hasProperty = <T, K extends keyof T | string>(obj: T, key: K): obj is T & Record<K, unknown> =>
  Object.prototype.hasOwnProperty.call(obj, key);

export const omit = <T, K extends keyof T>(obj: T, keys: K[]): Omit<T, K> => {
  const newObj = { ...obj };

  if (keys.length === 0) {
    return newObj;
  }

  if (keys.length === 1) {
    delete newObj[keys[0]];

    return newObj;
  }

  if (keys.length === 2) {
    delete newObj[keys[0]];
    delete newObj[keys[1]];

    return newObj;
  }

  return keys.reduce((acc, key) => {
    delete acc[key];

    return acc;
  }, newObj) as Omit<T, K>;
};

export const pick = <T, K extends keyof T>(obj: T, keys: K[]): Pick<T, K> => {
  if (keys.length === 0) {
    return {} as Pick<T, K>;
  }

  if (keys.length === 1) {
    return { [keys[0]]: obj[keys[0]] } as Pick<T, K>;
  }

  if (keys.length === 2) {
    return { [keys[0]]: obj[keys[0]], [keys[1]]: obj[keys[1]] } as Pick<T, K>;
  }

  return keys.reduce((acc, key) => Object.assign(acc, { [key]: obj[key] }), {} as Pick<T, K>);
};

interface PickOmitBy {
  <T extends AnyRecord>(obj: T, predicate: (key: keyof T, value: T[keyof T]) => boolean): Partial<T>;
  <T extends AnyRecord, R extends AnyRecord>(obj: T, predicate: (key: keyof T, value: T[keyof T]) => boolean): R;
}

export const pickBy: PickOmitBy = (obj: AnyRecord, predicate: (key: string, value: unknown) => boolean): AnyRecord =>
  Object.entries(obj).reduce<AnyRecord>((acc, [key, value]) => {
    if (predicate(key, value)) {
      acc[key] = value;
    }

    return acc;
  }, {});

export const omitBy: PickOmitBy = (obj: AnyRecord, predicate: (key: string, value: unknown) => boolean): AnyRecord =>
  Object.entries(obj).reduce<AnyRecord>(
    (acc, [key, value]) => {
      if (predicate(key, value)) {
        delete acc[key];
      }

      return acc;
    },
    { ...obj }
  );

/**
 * @deprecated use pickBy instead
 */
export const filterEntries = pickBy;

export const mapEntry = <T, R>(obj: Record<string | number | symbol, T>, callback: (entry: [key: string, value: T]) => [string, R]) =>
  Object.fromEntries(Object.entries(obj).map(callback));

export const mapValue = <T, R>(obj: Record<string | number | symbol, T>, callback: (value: T) => R) =>
  Object.fromEntries(Object.entries(obj).map(([key, value]) => [key, callback(value)]));

export const shallowPartialEquals = <T extends object>(obj: T, partial: Partial<T>) =>
  Object.entries(partial).every(([key, partialValue]) => hasProperty(obj, key) && partialValue === obj[key]);

import { Struct } from '@common/types';

import { isObject } from './common';

export const deepMap = <T = Struct>(
  object: unknown,
  mapFunction: (value: unknown, key: string | number) => unknown,
  options: { inPlace?: boolean } = {}
): T => {
  const cache = new WeakMap<object, unknown>();

  const mapArray = (arr: unknown[]): unknown[] => {
    if (cache.has(arr)) {
      return cache.get(arr) as unknown[];
    }

    const result = options.inPlace ? arr : [];

    cache.set(arr, result);

    const { length } = arr;
    for (let index = 0; index < length; index++) {
      result[index] = map(arr[index], index);
    }

    return result;
  };

  const mapObject = (obj: Struct): Struct => {
    if (cache.has(obj)) {
      return cache.get(obj) as Struct;
    }

    const result = options.inPlace ? obj : {};

    cache.set(obj, result);

    // eslint-disable-next-line no-restricted-syntax
    for (const key of Object.keys(obj)) {
      result[key] = map(obj[key], key);
    }

    return result;
  };

  const map = (value: unknown, key?: string | number) => {
    if (Array.isArray(value)) return mapArray(value);
    if (isObject(value)) return mapObject(value);

    return mapFunction(value, key!);
  };

  return map(object) as T;
};

export const deepMapKeys = <T = Struct>(object: unknown, mapFunction: (key: string, value: unknown) => string): T => {
  const cache = new WeakMap<object, unknown>();

  const mapArray = (arr: unknown[]): unknown[] => {
    if (cache.has(arr)) {
      return cache.get(arr) as unknown[];
    }

    const result: unknown[] = [];

    cache.set(arr, result);

    const { length } = arr;
    for (let i = 0; i < length; i++) {
      result.push(map(arr[i]));
    }

    return result;
  };

  const mapObject = (obj: Struct): Struct => {
    if (cache.has(obj)) {
      return cache.get(obj) as Struct;
    }

    const result: Struct = {};

    cache.set(obj, result);

    // eslint-disable-next-line no-restricted-syntax
    for (const key of Object.keys(obj)) {
      result[mapFunction(key, obj[key])] = map(obj[key]);
    }

    return result;
  };

  const map = (value: unknown) => {
    if (Array.isArray(value)) return mapArray(value);
    if (isObject(value)) return mapObject(value);

    return value;
  };

  return map(object) as T;
};

import { AnyRecord } from '@common/types';
import _transform from 'lodash/transform';

const defaultCompare = <T>(left: T, right: T): boolean => left === right;

export const getTopLevelDiff = <S extends AnyRecord>(object: S, base: S, compare = defaultCompare): Partial<S> => {
  const changes = (object: S, base: S) =>
    _transform<S, Partial<S>>(object, (result, value, key) => {
      if (!compare(value, base[key])) {
        // eslint-disable-next-line no-param-reassign
        result[key] = value;
      }
    });

  return changes(object, base);
};

import { BuiltinSlot, LOWER_CASE_CUSTOM_SLOT_TYPE, SLOT_REGEXP, SPACE_REGEXP } from '@common/constants';
import _sample from 'lodash/sample';

import { getAllSamples } from './slot';

export const formatIntentName = (name: string): string => {
  if (!name) {
    return name;
  }

  let formattedName = '';
  // replace white spaces with underscores
  formattedName = name.replace(SPACE_REGEXP, '_');
  // replace numbers with equivalent capital letter. Ex: 0 = A, 1 = B
  formattedName = formattedName.replace(/\d/g, (digit) => String.fromCharCode(parseInt(digit, 10) + 65));

  return formattedName;
};

export const getUtterancesWithSlotNames = ({
  slots = [],
  utterances = [],
}: {
  slots?: { key: string; name: string }[];
  utterances?: { text: string }[];
}): string[] =>
  utterances
    .filter((utterance) => !!utterance.text?.trim())
    .map(({ text }) =>
      text.replace(SLOT_REGEXP, (substring, _name: string, key: string) => {
        const slot = slots.find((_slot) => _slot.key === key);

        return slot?.name ? `{${slot.name}}` : substring;
      })
    );

export const getSlotType = (slots: BuiltinSlot<string, string>[], slot: { name: string; type: { value?: string } }): string => {
  let type = slot.name;
  const lowerCaseType = slot.type.value?.toLowerCase() ?? '';

  if (!!slot.type.value && lowerCaseType !== LOWER_CASE_CUSTOM_SLOT_TYPE) {
    const builtinSlot = slots.find((_slot) => _slot.label.toLowerCase() === lowerCaseType);

    if (!builtinSlot) {
      type = slot.type.value; // Platform specific slot
    } else {
      ({ type } = builtinSlot);
    }
  }

  return type;
};

export const VF_ENTITY_REGEXP = /{{\[(\w{1,32})]\.(\w{1,32})}}/gi;

export interface JSONEntity {
  startPos: number;
  endPos: number;
  entity: string;
  key: string;
}
export interface JSONUtterance {
  text?: string;
  entities?: JSONEntity[];
}

// extension of the String.prototype.replace format
const continuousReplace = (text: string, regex: RegExp, replacer: (substring: string, ...args: any[]) => string): string => {
  // regex without any global flags (g or i)
  const localRegex = new RegExp(regex, '');
  let temp: string | undefined;
  let current = text;

  // keep replacing until there is nothing else to replace (local replaces one instance at a time, this is important to keep positional offset data)
  while (temp !== current) {
    temp = current;
    current = current.replace(localRegex, replacer);
  }
  return current;
};

export const utteranceEntityPermutations = ({
  utterances,
  entitiesByID,
  limit = 22,
  replacer,
  getSamples = getAllSamples,
}: {
  utterances: string[];
  entitiesByID: Record<string, { inputs: string[]; name: string }>;
  limit?: number;
  replacer?: (sample: string, entityID: string) => string;
  getSamples?: (inputs: string[]) => string[];
  // eslint-disable-next-line sonarjs/cognitive-complexity
}): JSONUtterance[] => {
  const newUtterances: JSONUtterance[] = [];
  const entityRef: Record<string, { utterances: string[]; samples: string[] }> = {};

  const addNewUtterance = (utterance: string) => {
    if (!utterance?.trim()) return;

    const entities: JSONEntity[] = [];

    // Find all occurences of {entityName} in training utterances
    const text = continuousReplace(utterance, VF_ENTITY_REGEXP, (_match: string, entityName: string, entityID: string, offset: number) => {
      const entity = entitiesByID[entityID];
      if (!entity) return entityName;

      const sample = (entityRef[entityID]?.samples.shift() || _sample(getSamples(entity?.inputs)) || entityName).trim();
      if (!entityRef[entityID]?.samples?.length) delete entityRef[entityID];

      const replacement = replacer?.(sample, entityID) ?? sample;

      // This module should additionally create one full training utterance with positional entity (startPos, endPos, entityName).
      const startPos = offset || 0;
      const endPos = startPos + replacement.length - 1;
      entities.push({
        startPos,
        endPos,
        entity: entity.name,
        key: entityID,
      });

      // Replace the entities with the replacement value
      return replacement;
    });

    newUtterances.push({
      text,
      entities,
    });
  };

  // find all the entities referenced by this intent
  // first pass over all utterances guarantees every utterance used
  utterances.forEach((utterance) => {
    // find all the entities used in this utterance
    const entityMatches = [...utterance.matchAll(VF_ENTITY_REGEXP)];
    entityMatches.forEach((match) => {
      const entityID = match[2];
      // if this entity hasn't been visited before, initialize the ref and populate samples with all synonyms of the entity
      if (!entityRef[entityID]) {
        entityRef[entityID] = { samples: [], utterances: [] };
        const entity = entitiesByID[entityID];
        if (entity) {
          entityRef[entityID].samples.push(...getSamples(entity.inputs));
        }
      }

      entityRef[entityID].utterances.push(utterance);
    });

    addNewUtterance(utterance);
  });

  while (Object.keys(entityRef).length > 0 && newUtterances.length < limit) {
    const entityID = Object.keys(entityRef)[0];
    const utterancesUsingEntity = entityRef[entityID]?.utterances;

    if (utterancesUsingEntity?.length) {
      addNewUtterance(utterancesUsingEntity[newUtterances.length % utterancesUsingEntity.length]);
    } else {
      delete entityRef[entityID];
    }
  }

  return newUtterances;
};

const ALPHANUMERIC_REGEXP = /[\dA-Za-z{}]/;
// some NLP/NLU models do not allow entity classifications without a space seperator: 'I work at {startupName}flow' => 'I work at {startupName} flow'
export const injectUtteranceSpaces = (originalUtterance: string): string => {
  let spacesAdded = 0;

  let utterance = originalUtterance ? originalUtterance.trim() : '';
  const slots = [...utterance.matchAll(VF_ENTITY_REGEXP)];
  slots.forEach((slot) => {
    let index = slot.index! + spacesAdded;

    // Check if space should be added before slot
    if (index > 0 && utterance[index - 1].match(ALPHANUMERIC_REGEXP)) {
      utterance = `${utterance.slice(0, index)} ${utterance.slice(index)}`;
      ++spacesAdded;
      ++index;
    }

    // Check if space should be added after slot
    if (index + slot[0].length < utterance.length - 1 && utterance[index + slot[0].length].match(ALPHANUMERIC_REGEXP)) {
      utterance = `${utterance.slice(0, index + slot[0].length)} ${utterance.slice(index + slot[0].length)}`;
      ++spacesAdded;
    }
  });

  return utterance;
};

